  "judgement": "sí",
  "continuation": "entre riberas de oloroso almizcle!\n¡Aves que alzáis el cántico anhelante!\n¡Fuentes sonoras de cristal que os quiebra!\n¡Sitios que amé de niño, y que constante\nmi corazón amante\npor vosotros palpita en la tiniebla!"
}

Este es un poema del escritor mexicano Manuel José Othón titulado "Nostalgia", que forma parte de sus poemas líricos. Es un soneto que expresa la añoranza por los lugares de la infancia y la naturaleza.
